#include "../interfaces/market_interface.mligo"
#include "../interfaces/market_errors.mligo"

(*
  Default empty Bid entry
*)
let empty_bid_entry: bid_entry = {rate = 0n; quantity = 0n; total_token = 0n;}

(*
  Empty operations list
*)
let empty_operations: operation list = []

(*
  Creates and returns a default question entry
*)
let get_default_question_entry (params: create_question_params): question_entry =
  let empty_bid_registry: bid_registry = Map.empty in
  {
    owner         = Tezos.sender;
    state         = (QuestionAuctionOpen: question_state);
    auction_end   = params.auction_end;
    market_close  = params.market_close;
    auction_bids  = empty_bid_registry;
    uniswap_id    = (None: uniswap_id option);
    tokens        = (None: question_tokens option);
    answer        = (None: bytes option);
    reward_token  = (None: token_id option);
    total_auction_quantity = 0n;
    yes_preference = 0n;
    uniswap_contribution_factor = 0n;
  }

let is_owner_or_manager (owner: address) =
  if owner <> Tezos.sender then failwith err_ONLY_OWNER_OR_MANAGER

(*
  Updates the provided question map and returns it
*)
let update_question_map (question, entry, current_map: question * question_entry * question_map): question_map =
  Big_map.update question (Some(entry)) current_map

let update_uniswap_map (id, storage, uniswaps: uniswap_id * uniswap_storage * multi_uniswap_storage): multi_uniswap_storage =
  Map.update id (Some(storage)) uniswaps

let get_uniswap_storage (id, storage: uniswap_id * multi_uniswap_storage): uniswap_storage =
  match Big_map.find_opt id storage with
  | None -> (failwith err_UNISWAP_NOT_FOUND : uniswap_storage)
  | Some s -> s

let get_uniswap_id (entry: question_entry): uniswap_id =
  match entry.uniswap_id with
  | None -> (failwith err_UNISWAP_NOT_SET: uniswap_id)
  | Some x -> x

let update_uniswap_ledger (addr, value, uni_storage: address * nat * uniswap_storage): uniswap_storage =
  let contract_balance : nat = match Map.find_opt Tezos.self_address uni_storage.accounts with
    | None -> (failwith err_UNISWAP_NOT_SET : nat) (* the correct error? *)
    | Some(x) -> x in
  let new_ledger = Map.update addr (Some(value)) uni_storage.accounts in
  let new_ledger = Map.update Tezos.self_address
                     (Some(sub contract_balance value)) new_ledger in
  { uni_storage with accounts = new_ledger;}

let get_question_tokens (question_details: question_entry): question_tokens =
  match question_details.tokens with
  | None -> (failwith err_TOKENS_NOT_FOUND: question_tokens)
  | Some tok -> tok

let set_user_balance (addr, token_id, value, storage: address * token_id * nat * market_storage): market_storage =
  let new_ledger = update_ledger_balance((addr, token_id), storage.tokens.ledger, value) in
  {storage with tokens = {storage.tokens with ledger = new_ledger;}}

let calculate_clearing_price (entry: question_entry): nat =
  entry.yes_preference / entry.total_auction_quantity

let init_token_supply(token_id, token_storage: token_id * multi_token_storage): multi_token_storage =
  let curr_supply_opt = Big_map.find_opt token_id (token_storage.token_total_supply) in
  let supply = match curr_supply_opt with
    | None -> Big_map.update token_id (Some(0n)) token_storage.token_total_supply
    | Some x -> (failwith err_TOKEN_ALREADY_INITIALIZED: token_total_supply) in
  {token_storage with token_total_supply = supply;}

(*
  Create Tokens
  Given a quesntion_entry create a yes/no token pair
*)
let create_tokens (question_details, storage: question_entry * market_storage): market_storage * question_entry =
  let last_token_created = storage.last_token_created in
  let new_yes_id = increment storage.last_token_created in
  let token_storage = init_token_supply(new_yes_id, storage.tokens) in
  let new_no_id = increment new_yes_id in
  let token_storage = init_token_supply(new_no_id, token_storage) in
  let new_tokens: question_tokens = {
    yes_token_id = new_yes_id;
    no_token_id = new_no_id;
    } in

  {storage with last_token_created = new_no_id; tokens = token_storage;}, {question_details with tokens = (Some(new_tokens));}

(*
  Create Uniswap
  Given a question_entry create a uniswap for question tokens
*)
let create_uniswap (question_details, storage: question_entry * market_storage): market_storage * question_entry =
  let new_uniswap_id = increment storage.last_uniswap_created in
  let new_lqt_ledger: lqt_ledger = Map.empty in
  let tokens: question_tokens = get_question_tokens (question_details) in
  let new_s: liquidity_pool = {
    clearing_price = 0n;
    lqt_total      = 0n;
    manager        = sender;
    yes_token_id   = (tokens.yes_token_id);
    no_token_id    = (tokens.no_token_id);
    yes_token_pool = 0n;
    no_token_pool  = 0n;
  } in
  let new_uniswap_storage = {s = new_s; accounts = new_lqt_ledger;} in
  let updated_uniswaps = update_uniswap_map(new_uniswap_id, new_uniswap_storage, storage.uniswaps) in
  {storage with last_uniswap_created = new_uniswap_id; uniswaps = updated_uniswaps;},
  {question_details with uniswap_id = (Some(new_uniswap_id))}

(*
  Checks if the question exists and if yes then fails
*)
let question_exists (question, current_ques_map: question * question_map) =
  match Big_map.find_opt question current_ques_map with
  | None -> unit
  | Some entry -> failwith err_QUESTION_ALREADY_EXISTS

(*
  Checks if the question exists if yes then returns it else fails
*)
let get_question_entry (question, current_ques_map: question * question_map): question_entry =
  match Big_map.find_opt question current_ques_map with
  | None -> (failwith err_QUESTION_NOT_FOUND: question_entry)
  | Some entry -> entry

(*
  Validates the params for create question endpoint
  1. checks if question exits, if yes then fails
  2. checks if timestamps are in past or present, if yes then fails
  3. checks if auction_end >= market_close, if yes then fail
*)
let validate_question_params (params, storage: create_question_params * market_storage) =
  let x = question_exists(params.question, storage.questions) in
  if params.auction_end <= Tezos.now then failwith err_DATE_SHOULD_ALWAYS_BE_IN_FUTURE
  else if params.market_close <= Tezos.now then failwith err_MARKET_CLOSE_DATE_SHOULD_ALWAYS_BE_IN_FUTURE
  else if params.market_close <= params.auction_end then failwith err_MARKET_CLOSE_CANNOT_BE_LE_AUCTION_END

(*
  Validates the bid_params
  fails if bid is made after auction has ended or provided rate is invalid

  TODO: verify that the rate validity check is correct
*)
let is_valid_bid (params, storage: bid_params * market_storage): question_entry =
  let entry = get_question_entry (params.question, storage.questions) in
  if Tezos.now > entry.auction_end then (failwith err_CAN_NOT_SUBMIT_BID_AFTER_AUCTION_HAS_ENDED: question_entry)
  else if params.rate > one || params.rate = 0n then (failwith err_INVALID_RATE: question_entry)
  else entry

(*
  Get user bid
  finds the previous bid submitted by the user and returns it
  else returns an empty bid
*)
let get_user_bid (from, entry: address * question_entry): bid_entry =
  match Map.find_opt from entry.auction_bids with
  | None -> empty_bid_entry
  | Some bid -> bid

(*
  Update user bid
*)
let update_user_bid (user_address, updated_bid, auctions: address * bid_entry * bid_registry): bid_registry =
  Map.update user_address (Some(updated_bid)) auctions


let mint_yes_no (entry, addr, amt, storage:
                  question_entry * address * nat * multi_token_storage): ledger * token_total_supply =
  let token_ids = get_question_tokens(entry) in
  let ledger, token_total_supply = mint(addr, token_ids.yes_token_id, amt,
                                        storage.ledger, storage.token_total_supply ) in
  mint(addr, token_ids.no_token_id, amt, ledger, token_total_supply)


let validate_reward_token(entry, reward_token: question_entry * token_id) =
  let tokens = get_question_tokens(entry) in
  if reward_token <> tokens.yes_token_id && reward_token <> tokens.no_token_id then failwith err_INVALID_REWARD_TOKEN

(*
    ***********************************
    Entry points
    ***********************************
*)

(*
  Create Question: Validates the provided params and creates a question
*)
let create_question (params, storage: create_question_params * market_storage): market_storage =
  let x = validate_question_params(params, storage) in
  let new_entry = get_default_question_entry(params) in
  let updated_storage, q_entry = create_tokens(new_entry, storage) in
  let updated_storage, q_entry = create_uniswap(q_entry, updated_storage) in
  let new_questions_map = update_question_map(params.question, q_entry, updated_storage.questions) in
  {updated_storage with questions = new_questions_map;}

(*
  Bid
  Calculates the user bid in stablecoin and transfers them to the market contract
  and registers the bid
*)
let bid (params, storage: bid_params * market_storage): operation list * market_storage =
  let question_entry = is_valid_bid (params, storage) in
  let tx_ops = transfer_stablecoin((Tezos.sender,
                                    (Tezos.self_address, params.quantity)),
                                   storage.stablecoin) in
  let yes_tokens = params.quantity * params.rate in
  let new_user_bid = {rate = params.rate;
                      quantity = params.quantity;
                      total_token = yes_tokens;} in
  let new_auction_bids = update_user_bid(Tezos.sender, new_user_bid, question_entry.auction_bids) in
  let new_total_auction_quantity = question_entry.total_auction_quantity + params.quantity in
  let new_yes_preference = add question_entry.yes_preference yes_tokens in
  let new_uniswap_contribution_factor = add question_entry.uniswap_contribution_factor (mul params.quantity (min params.rate (sub one params.rate))) in
  let updated_question_entry = {question_entry with
                                auction_bids = new_auction_bids;
                                total_auction_quantity = new_total_auction_quantity;
                                yes_preference = new_yes_preference;
                                uniswap_contribution_factor = new_uniswap_contribution_factor;
                               } in
  let new_questions = update_question_map(params.question, updated_question_entry, storage.questions) in
  [tx_ops], {storage with questions = new_questions;}

(*
  Close the market
  Sets the answer, winning token and marks the question market as closed
*)
let close_market (params, storage: close_market_params * market_storage): market_storage =
  let entry = get_question_entry (params.question, storage.questions) in
  let x = is_owner_or_manager (entry.owner) in
  if Tezos.now > entry.market_close then
    let x = validate_reward_token(entry, params.reward_token) in
    let new_questions = update_question_map(params.question, {
        entry with
        state = (QuestionMarketClosed: question_state);
        answer = Some(params.answer);
        reward_token = Some(params.reward_token);
        }, storage.questions) in
    {storage with questions = new_questions;}
  else (failwith err_MARKET_CAN_ONLY_BE_CLOSED_AFTER_MARKET_CLOSE_DATE: market_storage)

(*
  Close auction entrypoint
*)
let close_auction (question, storage: question * market_storage): market_storage =
  let entry = get_question_entry (question, storage.questions) in
  let x = is_owner_or_manager (entry.owner) in
  if Tezos.now > entry.auction_end then
    let clearing_price = calculate_clearing_price(entry) in
    let yes_contrib = div entry.uniswap_contribution_factor clearing_price in
    let no_contrib = div entry.uniswap_contribution_factor (sub one clearing_price) in
    let uniswap_id = get_uniswap_id (entry) in
    let uniswap_data = get_uniswap_storage (uniswap_id, storage.uniswaps) in
    let lqt_total = add yes_contrib no_contrib in
    let new_uniswap_storage : uniswap_storage =
      { s = ({ uniswap_data.s with
               clearing_price = clearing_price;
               yes_token_pool = yes_contrib;
               no_token_pool = no_contrib;
               lqt_total = lqt_total; });
        accounts = Map.literal [Tezos.self_address, lqt_total;]; } in
    let new_uniswaps = update_uniswap_map(uniswap_id, new_uniswap_storage, storage.uniswaps) in
    let new_questions = update_question_map(question, {
      entry with
      state = (QuestionAuctionWithdrawOpen: question_state);
    }, storage.questions) in
    {storage with questions = new_questions; uniswaps = new_uniswaps;}
  else (failwith err_AUCTION_CAN_ONLY_BE_CLOSED_AFTER_AUCTION_END_DATE: market_storage)


(*
  Entry point to claim tokens from an auction after it has finished
*)
let withdraw_tokens_from_auction (question, storage: question * market_storage): market_storage =
  let entry = get_question_entry (question, storage.questions) in
  if Tezos.now > entry.auction_end then
    let user_bid = get_user_bid(Tezos.sender, entry) in
     if user_bid.quantity > 0n then
       let clearing_price : nat = calculate_clearing_price(entry) in
       let yes_alloc = div (mul user_bid.quantity user_bid.rate) clearing_price in
       let no_alloc = div (mul user_bid.quantity (sub one user_bid.rate)) (sub one clearing_price) in
       let user_lqt = if yes_alloc > no_alloc then no_alloc else yes_alloc in
       let uniswap_id = get_uniswap_id (entry) in
       let uniswap_data = get_uniswap_storage (uniswap_id, storage.uniswaps) in
       let new_uniswap_storage = update_uniswap_ledger(Tezos.sender, user_lqt, uniswap_data) in
       let new_uniswaps = update_uniswap_map(uniswap_id, new_uniswap_storage, storage.uniswaps) in
       let tokens = get_question_tokens (entry) in
       let updated_storage =
        set_user_balance (Tezos.sender,
                        (if yes_alloc > no_alloc then tokens.yes_token_id else tokens.no_token_id),
                        (if yes_alloc > no_alloc then yes_alloc else no_alloc), storage) in
       {updated_storage with uniswaps = new_uniswaps;}
     else storage
  else (failwith  err_TOKENS_CAN_ONLY_BE_CLAIMED_AFTER_AUCTION_END: market_storage)

