TODO: Add slippage control
*)

let buy_yes (params, storage: buy_params * market_storage): operation list * market_storage =
  let entry = get_question_entry (params.question, storage.questions) in
  let uniswap_id = get_uniswap_id (entry) in
  let uniswap_data = get_uniswap_storage (uniswap_id, storage.uniswaps) in
  let (from_swap, from_mint) = calc_buy_yes_token (params.coin_quantity, uniswap_data) in
  let tx_ops = transfer_stablecoin((Tezos.sender,
              (Tezos.self_address, params.coin_quantity)), storage.stablecoin) in
  let token_ids = get_question_tokens(entry) in
  let (ledger, token_total_supply) = mint_yes_no(entry, Tezos.sender, from_mint, storage.tokens) in
  let result = no_token_to_yes_token(
                {to_ = sender;
                exact_tokens_sell = from_mint;
                min_tokens_bought = from_swap;
                deadline = (params.deadline);
                ledger = ledger;
                }, uniswap_data) in
  let uniswap_storage = update_uniswap_map(uniswap_id, result.uniswap_storage, storage.uniswaps) in
  let new_tokens = {storage.tokens with ledger = (result.ledger); token_total_supply = token_total_supply; } in
  [tx_ops], {storage with
              uniswaps = uniswap_storage;
              tokens = new_tokens;}

let buy_no (params, storage: buy_params * market_storage): operation list * market_storage =
  let entry = get_question_entry (params.question, storage.questions) in
  let uniswap_id = get_uniswap_id (entry) in
  let uniswap_data = get_uniswap_storage (uniswap_id, storage.uniswaps) in
  let (from_swap, from_mint) = calc_buy_no_token (params.coin_quantity, uniswap_data) in
  let tx_ops = transfer_stablecoin((Tezos.sender,
              (Tezos.self_address, params.coin_quantity)), storage.stablecoin) in
  let token_ids = get_question_tokens(entry) in
  let (ledger, token_total_supply) = mint_yes_no(entry, Tezos.sender, from_mint, storage.tokens) in
  let result = yes_token_to_no_token(
                {to_ = sender;
                exact_tokens_sell = from_mint;
                min_tokens_bought = from_swap;
                deadline = (params.deadline);
                ledger = ledger;
                }, uniswap_data) in
  let uniswap_storage = update_uniswap_map(uniswap_id, result.uniswap_storage, storage.uniswaps) in
  let new_tokens = {storage.tokens with ledger = (result.ledger); token_total_supply = token_total_supply; } in
  [tx_ops], {storage with
              uniswaps = uniswap_storage;
              tokens = new_tokens;}

let main (action, m_storage: market_entry_points * market_storage) =
 let ops, storage =
   match action with
   | CreateQuestion params -> empty_operations, create_question (params, m_storage)
   | Bid params -> bid (params, m_storage)
   | CloseMarket params -> empty_operations, close_market (params, m_storage)
   | CloseAuction params -> empty_operations, close_auction (params, m_storage)
   | WithdrawAuction params -> empty_operations, withdraw_tokens_from_auction (params, m_storage)
   | BuyYes params -> buy_yes (params, m_storage)
   | BuyNo params -> buy_no (params, m_storage)
 in
 ops, storage
